class Solution {
  List<int> numberGame(List<int> nums) {
    // Initialize the resulting array 'arr'
    List<int> arr = [];

    // Continue the process until 'nums' becomes empty
    while (nums.isNotEmpty) {
      // Sort 'nums' to easily remove the minimum elements
      nums.sort();

      // Alice removes the minimum element
      int aliceRemoved = nums.removeAt(0);

      // Bob removes the next minimum (now the minimum) element
      int bobRemoved = nums.removeAt(0);

      // Bob appends his removed element first
      arr.add(bobRemoved);

      // Alice appends her removed element
      arr.add(aliceRemoved);
    }

    return arr;
  }
}
